// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract ConvertGweiToUSDT {
    // 假设以太坊的价格已经传递给合约，以太坊价格的精度是8位小数
    uint256 public ethPriceInUSDT = 250146803616; // 2501.146803616 USDT with 8 decimals

    // 将 Gwei 转换为 USDT
    function convertGweiToUSDT(uint256 gweiAmount) public view returns (uint256) {
        // 1 Gwei = 10^-9 ETH
        // 先将 gweiAmount 转换为 ETH，然后乘以 ETH 的价格
        uint256 ethAmount = gweiAmount * 10**9; // 转换为 wei
        uint256 usdtAmount = (ethAmount * ethPriceInUSDT) / 10**27; // 计算 USDT 金额，处理精度

        return usdtAmount; // 返回 USDT 数量
    }
}

